<?php

// Define constants
$BASE_URL = "http://api.openweathermap.org/data/2.5/weather?";
$API_KEY = "cd6ea3830a487d7be38b9fd2f77048e0";

// Input coordinates (latitude and longitude)
// Replace with the actual coordinates you want, or take them from user input
$LAT = 14.2260;  // Example latitude for Calamba
$LON = 121.1371; // Example longitude for Calamba

// path3 Silangan 14.202531, 121.168957
$LAT_Silangan = 14.202531;
$LON_Silangan = 121.168957;
// path4 Watawat & FJ2 14.198201, 121.164368
$LAT_Watawat = 14.198201;
$LON_Watawat = 121.164368;
// path5 Lote 14.203318, 121.161579
$LAT_Lote = 14.203318;
$LON_Lote = 121.161579;
// path6 Ramada 14.206813, 121.170720
$LAT_Ramada = 14.206813;
$LON_Ramada = 121.170720;
// path7 FJ 14.207229, 121.165312
$LAT_FJ = 14.207229;
$LON_FJ = 121.165312;
// path9 Ronggot 14.200947, 121.179420
$LAT_Ronggot = 14.200947;
$LON_Ronggot = 121.179420;
// path8 Barera 14.200864, 121.157416
$LAT_Barera = 14.200864;
$LON_Barera = 121.157416;
// path10 Kanluran 14.197743, 121.160549
$LAT_Kanluran = 14.197743;
$LON_Kanluran = 121.160549;

// Define the coordinates for all the paths
$locations = [
    'Silangan' => ['lat' => 14.202531, 'lon' => 121.168957],
    'Watawat' => ['lat' => 14.198201, 'lon' => 121.164368],
    'Lote' => ['lat' => 14.203318, 'lon' => 121.161579],
    'Ramada' => ['lat' => 14.206813, 'lon' => 121.170720],
    'FJ' => ['lat' => 14.207229, 'lon' => 121.165312],
    'Ronggot' => ['lat' => 14.200947, 'lon' => 121.179420],
    'Barera' => ['lat' => 14.200864, 'lon' => 121.157416],
    'Kanluran' => ['lat' => 14.197743, 'lon' => 121.160549]
];


// Function to get weather description
function myFunction($LAT, $LON) {
    global $API_KEY;
    global $BASE_URL;

    $url = $BASE_URL . "appid=" . $API_KEY . "&lat=" . $LAT . "&lon=" . $LON;
    $response = file_get_contents($url);
    $responseData = json_decode($response, true);

    if ($responseData && $responseData['cod'] == 200) {
        return $responseData['weather'][0]['description'];
    } else {
        return "Error: No data";
    }
}

// Generate weather color data for all locations
$weatherData = [];
foreach ($locations as $name => $coords) {
    $weatherDescription = myFunction($coords['lat'], $coords['lon']);
    
    // Determine color based on weather description
    $color = "#c7ffc1"; // default to white
    if (strpos($weatherDescription, 'clear') !== false || strpos($weatherDescription, 'clouds') !== false) {
        $color = "#66cc66"; // Green for clear weather
    } elseif (strpos($weatherDescription, 'light rain') !== false || strpos($weatherDescription, 'drizzle') !== false) {
        $color = "#cccc33"; // Yellow for light rain
    } elseif (strpos($weatherDescription, 'shower') !== false || strpos($weatherDescription, 'moderate') !== false) {
        $color = "#cc6600"; // Orange for moderate rain
    } elseif (strpos($weatherDescription, 'heavy') !== false || strpos($weatherDescription, 'extreme') !== false || strpos($weatherDescription, 'thunderstorm') !== false) {
        $color = "#990000"; // Red for heavy rain
    }
    
    
    $weatherData[$name] = [
        'color' => $color,
        'path_id' => strtolower(str_replace(' ', '', $name)) // path id should match your SVG path ids
    ];
}

$description = myFunction($LAT, $LON);

?>


