    <script>
        // Function to send AJAX request and update the content of #myUpdate
        function updateContent() {
            var xhr = new XMLHttpRequest();
            xhr.open('GET', '?ajax=true', true); // Send GET request to the same PHP file with ajax=true
            xhr.onload = function() {
                if (xhr.status === 200) {
                                        // Update the content of the h5 element with id="myUpdate"
                                        document.getElementById('myUpdate').innerHTML = "Working";
                    var weatherData = <?php echo json_encode($weatherData); ?>; // Pass weather data from PHP to JavaScript
                    for (var location in weatherData) {
                        if (weatherData.hasOwnProperty(location)) {
                            var pathId = weatherData[location].path_id;
                            var color = weatherData[location].color;
                            setColor(pathId, color); // Set color dynamically based on weather data
                        }
                    }
                }
            };
            xhr.send(); // Send the request
        }

        // Call the updateContent function every 5 seconds (5000 ms)
        setInterval(updateContent, 1000);

        // Function to set the color of the path based on the weather
        function setColor(pathId, color) {
            var path = document.getElementById(pathId);
            if (path) {
                path.setAttribute("style", "fill:" + color + ";stroke:#000000;stroke-width:1.00031;stroke-dasharray:none;stroke-opacity:1");
            }
        }
    </script>

</head>
